Week1(){
const pre= [];
for (var i=24;i<29;i++){
pre.push(<span>{i}</span>)
}
const lspre=pre.map((nr) =>
<span  key={nr.toString()}>{nr}&nbsp;&nbsp;</span>
);
const nums= [];
