}

const res=nums.splice(2,1)
const thr=<a href="item3">{res}</a>
    nums.splice(2,0,<span>{thr}</span>)
const ls=nums.map((nr) =>
<span key={nr.toString()}>&nbsp;&nbsp;{nr}&nbsp;&nbsp;</span>
);

return(
<span id="bkg1">{ls}</span>
);
}

